let currentChannel = null;


// メッセージを表示する関数
function displayMessages(channelName, messages) {
  currentChannel = channelName;
  messagesContainer.innerHTML = ''; // 既存メッセージをクリア

  messages.forEach((message) => {
    const messageElement = document.createElement('div');
    messageElement.classList.add('message');

    const avatar = document.createElement('img');
    avatar.src = message.user_avatar || "https://via.placeholder.com/40";
    avatar.alt = message.user_name;

    const content = document.createElement('div');
    content.classList.add('message-content');

    const header = document.createElement('div');
    header.classList.add('message-header');
    header.textContent = `${message.user_name}`;

    const text = document.createElement('div');
    text.textContent = message.text;

    const time = document.createElement('div');
    time.classList.add('message-time');
    time.textContent = new Date(message.timestamp).toLocaleString();

    content.appendChild(header);
    content.appendChild(text);
    content.appendChild(time);
    messageElement.appendChild(avatar);
    messageElement.appendChild(content);

    messagesContainer.appendChild(messageElement);
  });
}

// チャンネルデータをロードする関数
async function loadChannelData(channelName) {
  const files = channels[channelName];
  let allMessages = [];

  for (const fileName of files) {
    try {
      const response = await fetch(`log/${channelName}/${fileName}`);
      if (!response.ok) throw new Error(`Failed to load: ${fileName}`);
      const messages = await response.json();
      allMessages = [...allMessages, ...messages];
    } catch (error) {
      console.error(error.message);
    }
  }

  // メッセージをタイムスタンプ順に並べ替える
  allMessages.sort((a, b) => new Date(a.timestamp) - new Date(b.timestamp));

  // メッセージを表示
  displayMessages(channelName, allMessages);
}

// タブを作成する関数
function createTabs() {
  Object.keys(channels).forEach((channelName, index) => {
    const tab = document.createElement('div');
    tab.classList.add('tab');
    tab.textContent = channelName;

    // 最初のタブをアクティブに
    if (index === 0) {
      tab.classList.add('active');
      loadChannelData(channelName);
    }

    // タブクリックイベント
    tab.addEventListener('click', () => {
      document.querySelectorAll('.tab').forEach((tab) => tab.classList.remove('active'));
      tab.classList.add('active');
      loadChannelData(channelName);
    });

    tabsContainer.appendChild(tab);
  });
}

// 初期化
createTabs();
